import React from "react";

function Error() {
  return (
    <div>
      <div className="message">
        <div className="icon">
          <i className="bi bi-exclamation-triangle"></i>
        </div>
        <span>You must hurry up!</span>
      </div>
    </div>
  );
}

export default Error;
